import React, {useState} from 'react'
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Carousel, ListGroup, Nav, Navbar, Container, NavDropdown} from 'react-bootstrap';
import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';

export const Pdf = () => {
    const [embedUrl]=useState('https://drive.google.com/file/d/1UaCdUdUJPO_NW2Qvj2iJUgRQkV2V5aTZ/preview')
    return(
        <div className="Container">
             <Navbar className="color-auto" variant="dark">
            <Container>
                <Navbar.Brand href="#home"><Link to="/"><img src={require('./ImgInicio/logo.png')} width='100%' height='50px'/>{' '}</Link></Navbar.Brand>
            <Nav className="me-auto">
                <Nav.Link><Link to="/">Inicio</Link></Nav.Link>
                <Nav.Link>Comics</Nav.Link>
                <Nav.Link>Información</Nav.Link>
            </Nav>
            <Nav>
                <Nav.Link><i class="fa-solid fa-heart fa-xl"></i></Nav.Link>
                <Nav.Link>Iniciar sesión</Nav.Link>
                <Nav.Link>Registrarse</Nav.Link>
            </Nav>
            </Container>
        </Navbar>
        <div class="PdfVista">
            <h1>El Batman Que Ríe #2</h1>
            <iframe src={embedUrl} width="1280" height="1000" allow="autoplay"></iframe>
        </div>  
    </div>
    )
}

export default Pdf;
